import {Component} from 'react';


class Users extends Component{
    constructor(props){
        super(props);
        this.state = {
            items: [],
            isLoaded: false
        }
    }

    componentDidMount(){
        fetch('https://jsonplaceholder.typicode.com/users')
        .then((res) => res.json())
        .then((data) => this.setState({
            item: data,
            DataIsLoaded: true
        }))
    }

    render (){
        const {items, DataIsLoaded} = this.state;
        return(
            <div>Hello</div>
        )
    }
}

export default Users
